import React from "react";
import { Map, Marker, TileLayer} from 'react-leaflet'
import { PropObject } from "../../generated/graphql";
import L from "leaflet";

interface Props {
     properties: PropObject[]
}



export const MapView: React.FC<Props> = (props) => {

     const firstProp = props.properties[0];
     console.log(props.properties)
     const position = {lat: firstProp.lat, lng: firstProp.long};
     const style = {
          width: '100%',
          height: '300px'
     };

     var noZoomMap = L.map('map',{ 
          center: position,
          zoom: 10,
          doubleClickZoom: false, 
          closePopupOnClick: false, 
          dragging: false, 
          zoomSnap: false, 
          zoomDelta: false, 
          trackResize: false,
          touchZoom: false,
          scrollWheelZoom: false
          }

     )

   return (
        <Map style={style} >
          <TileLayer
               url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
               attribution='&copy; <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
          />       
               {props.properties.map((prop) => {
                         return <Marker
                              key={prop.id}
                              position={[
                                   prop.lat,
                                   prop.long
                              ]}
                              onClick={() => {

                              }}
                         />    
                    }
               )}

        </Map>
   )
}
